import React from 'react';

function Section_Dessert() {
	const path = process.env.PUBLIC_URL;
	return (
		<figure id='dessert'>
			<div className='pic'>
				<img
					src={`${path}/img/dessert_visual.jpg`}
					alt='빵 위에 코코아파우더를 뿌리는 여자의 손'
				/>
				<h1>
					HOMEMAED
					<br />
					BAKERY
				</h1>
			</div>
		</figure>
	);
}

export default Section_Dessert;
